pragma solidity 0.5.11;

import {ERC721MintableComplete} from "./ERC721MintableComplete.sol";

// TODO define another contract named SolnSquareVerifier that inherits from your ERC721MintableComplete class
contract SolnSquareVerifier is ERC721MintableComplete {
    // TODO define a contract call to the zokrates generated solidity contract <Verifier> or <renamedVerifier>
    Verifier verifierContract;

    constructor(address verifierAddress) public {
        verifierContract = Verifier(verifierAddress);
    }

    // TODO define a solutions struct that can hold an index & an address
    struct Solution {
        address toAddress;
        uint256 tokenIndex;
        bool solutionExists;
        bool minted;
    }

    // TODO define an array of the above struct

    uint256 public totalSolutions = 0;

    // TODO define a mapping to store unique solutions submitted
    mapping(bytes32 => Solution) oneSolutions;

    // TODO Create an event to emit when a solution is added
    event SolutionAdded(uint256 tokenIndex, address indexed toAddress);

    // TODO Create a function to add the solutions to the array and emit the event

    function addSolution(
        uint256[2] memory a,
        uint256[2][2] memory b,
        uint256[2] memory c,
        uint256[2] memory input
    ) public {
        bytes32 solutionHash = keccak256(abi.encodePacked(input[0], input[1]));
        require(
            oneSolutions[solutionHash].solutionExists == false,
            "Solution exists"
        );

        bool verified = verifierContract.verifyTx(a, b, c, input);
        require(verified, "Solution could not be verified");

        oneSolutions[solutionHash] = Solution(
            msg.sender,
            totalSolutions,
            true,
            false
        );

        emit SolutionAdded(totalSolutions, msg.sender);
        totalSolutions += 1;
    }

    // TODO Create a function to mint new NFT only after the solution has been verified
    //  - make sure the solution is unique (has not been used before)
    //  - make sure you handle metadata as well as tokenSuplly
    function mintNewNFT(
        uint256 a,
        uint256 b,
        address to
    ) public {
        bytes32 solutionHash = keccak256(abi.encodePacked(a, b));

        require(
            oneSolutions[solutionHash].solutionExists == true,
            "Solution does not exist"
        );
        require(
            oneSolutions[solutionHash].minted == false,
            "Token already minted for this solution"
        );
        require(
            oneSolutions[solutionHash].toAddress == msg.sender,
            "Owner can use it to mint a token"
        );
        super.mint(to, oneSolutions[solutionHash].tokenIndex);
        oneSolutions[solutionHash].minted = true;
    }
}

// TODO define a contract call to the zokrates generated solidity contract <Verifier> or <renamedVerifier>
contract Verifier {
    function verifyTx(
        uint256[2] memory a,
        uint256[2][2] memory b,
        uint256[2] memory c,
        uint256[2] memory input
    ) public returns (bool r);
}
